import { createMuiTheme } from "@material-ui/core/styles";
import { green, orange } from "@material-ui/core/colors";

const theme = createMuiTheme({
  palette: {
    primary: {
      main: "#8bc34a",
      dark: "#689f38",
      contrastText: "#424242"
    },
    secondary: {
      main: "#81c784",
      contrastText: "#fafafa"
    }
  },
  status: {
    error: "#81c784"
  }
});

export default theme;
